import React from 'react'
import Blogs from '../blogData'

export default function BlogCard() {
  return (    
    <>
        {Blogs.map(blog => {
            return (
                <div class="col-6">
                    <div class="p-3 blog-card">
                        <h5>{blog.title}</h5>
                        <p>{blog.desc}</p>
                </div>
                </div> 
            )
        })}
    </>
  )
}



